import React from 'react';
import Container from '@/screen/Container';
import { Title, Paragraph, CodeBlock } from '@/components/SubComponent';

class Array_map extends React.Component {
  render() {
    return (
      <Container>
        <div style={{padding: '0 10px'}}>
          <Title title={'手写数组 map 方法'}></Title>
          <Paragraph title={'依照 ecma262 草案，实现的map的规范如下:'}></Paragraph>
          <img style={{width: '100%'}} src="data:image/webp;base64," alt=""/>
          <Paragraph title={'下面根据草案的规定一步步来模拟实现map函数:'}></Paragraph>
<CodeBlock content={
`Array.prototype.map = function(callbackFn, thisArg) {
  if (this === null || this === undefined) {
    throw new Error("Cannot read property 'map' of null or undefined");
  }
  if (Object.prototype.toString.call(callbackFn) !== '[object Function]') {
    throw new Error(callbackFn + 'is not a function');
  }
  const O = Object(this);
  const T = thisArg;
  const len = O.length >>> 0;
  const A = new Array(len);

  for (const k = 0; k < len; k++) {
    if (k in O) {
      const kValue = O[k];
      A[k] = kValue;
      callbackFn.call(T, kValue, k, O);
    }
  }
  return A;
}
`
}
/>
          <Paragraph title={'这里解释一下, length >>> 0, 字面意思是指"右移 0 位"，但实际上是把前面的空位用0填充，这里的作用是保证len为数字且为整数。'}></Paragraph>
          <Paragraph title={'举几个特例：'}></Paragraph>
<CodeBlock content={
`null >>> 0  //0

undefined >>> 0  //0

void(0) >>> 0  //0

function a (){};  a >>> 0  //0

[] >>> 0  //0

var a = {}; a >>> 0  //0

123123 >>> 0  //123123

45.2 >>> 0  //45

0 >>> 0  //0

-0 >>> 0  //0

-1 >>> 0  //4294967295

-1212 >>> 0  //4294966084
`
} />
          <Paragraph title={'总体实现起来并没那么难，需要注意的就是使用 in 来进行原型链查找。同时，如果没有找到就不处理，能有效处理稀疏数组的情况。'}></Paragraph>
          <Paragraph title={'最后给大家奉上V8源码，参照源码检查一下，其实还是实现得很完整了。'}></Paragraph>
<CodeBlock content={
`function ArrayMap(f, receiver) {
  CHECK_OBJECT_COERCIBLE(this, "Array.prototype.map");

  // Pull out the length so that modifications to the length in the
  // loop will not affect the looping and side effects are visible.
  var array = TO_OBJECT(this);
  var length = TO_LENGTH(array.length);
  if (!IS_CALLABLE(f)) throw %make_type_error(kCalledNonCallable, f);
  var result = ArraySpeciesCreate(array, length);
  for (var i = 0; i < length; i++) {
    if (i in array) {
      var element = array[i];
      %CreateDataProperty(result, i, %_Call(f, receiver, element, i, array));
    }
  }
  return result;
}
`
} />
        </div>
      </Container>
    );
  }
}

export default Array_map;
